import Chat from './Component/Chat';
import Sidebar from './Component/Sidebar';
// import ReactDOM from "react-dom/client";
import {
  BrowserRouter,
  Routes
} from "react-router-dom";

function App() {
  return (
    < BrowserRouter>
    <div className="App">
      <div className="app__body">
      <Sidebar/>


     <Routes exact path='/' element={<Chat/>}>
     </Routes>

     <Routes path='/room/:roomId' element={<Chat/>}>
     </Routes>


      </div>

    </div>
    </ BrowserRouter>
  );
}

export default App;

